@Tuan Dao @duongna [τ, ψ] @Auco I found the reason @duongna [τ, ψ]'s model is showing different behavior with gasbench compared to the current benchmark. The pipeline used to prepare data for v2 unintentionally introduced extra transforms (prior to benchmark logic), which means for some of the data added in v2, augmentations were applied multiple times.

This means current results are partially based on data that are augmented too aggressively (multiple resizes, for example), and thus aren't aligned with the challenge data/transforms presented to miners. **In the name of transparency and fairness, we will re-benchmark top models to confirm the winners**.

Benchmarking is currently paused, any submissions made now will be considered in the next evaluation cycle
